INSERT INTO `log_changelog` (`Version`, `Notes`) VALUES
('4.5.0.0', 'Manitowoc Tool and Manufacturing WIP Application\nVersion: 4.5.0.0\nRelease Date: 1/5/2025\n\nPatch Notes:\n\n1/6/2025 Hotfix - You can no longer have more than 1 instance of the application open at once.\n\nNew Feature - Change Log (You are currently reading it)\n\nBug Fixes and code rework of Personal History.\n\nNew Bug Reporting System - In the Event of an error the application will now upload the error details to the WIP server so I can more easily pinpoint problems with the application.  No need to tell me about errors anymore! Well still do, but I can catch them as well.\n\nTransfer Tab Quantity - You can now input a quantity into the Transfer Tab, doing so will split the quantity between the old location and the location you are moving it to.\n\nNo more having to restart after Adding or Removing New Part Numbers, Locations, Users, exc...\n\nWhen exiting the Multiple entries screen, via the Inventory Tab the main window will now reset like it should.\n\nRenamed the 3 tabs to Inventory, Removal and Transfer Tabs those names just seem to make more sense.\n\nUsed AI to look over all methods in the application and had it rework a lot of the code for better performance.'),
('4.5.0.1', 'Manitowoc Tool and Manufacturing WIP Application\r\nVersion: 4.5.0.1\r\nRelease Date: 1/6/2025\r\n\r\nPatch Notes:\r\n\r\n1/6/2025 Hotfix - You can no longer have more than 1 instance of the application open at once.'),
('4.5.0.2', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil\\fcharset2 Symbol;}}\r\n{\\colortbl ;\\red30\\green30\\blue30;}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\cf1\\b\\f0\\fs20 Date:\\b0  01/12/2025\\line\\b Version:\\b0  4.5.0.2\\par\r\n\\par\r\n\\b New Feature: Note Editor (Used for Assembly to add Work Order #s to exsisting Transactions)\\b0\\par\r\nThis method allows users to edit notes for selected items in the Remove tab. It helps users view and update notes related to different parts and operations.\\par\r\n\\par\r\n\\b How to Use (Only usable in the Removal Tab, not the Transaction Tab):\\b0\\par\r\n\r\n\\pard \r\n{\\pntext\\f0 1.\\tab}{\\*\\pn\\pnlvlbody\\pnf0\\pnindent0\\pnstart1\\pndec{\\pntxta.}}\r\n\\fi-360\\li720\\b Select Items:\\b0  Click on the items in the list that you want to edit. You can select multiple items by holding down the Ctrl key while clicking.\\par\r\n{\\pntext\\f0 2.\\tab}\\b Click Edit:\\b0  Click the \"Edit\" button to open the edit window.\\par\r\n{\\pntext\\f0 3.\\tab}\\b Edit Notes:\\b0  In the edit window, you can change the notes for the selected items.\\par\r\n{\\pntext\\f0 4.\\tab}\\b Editing Notes:\\b0  You can edit the notes in the text box. Click the save button to save your changes. If there are more notes, it will show the next one.\\par\r\n{\\pntext\\f0 5.\\tab}\\b Skipping Notes:\\b0  Click the skip button to move to the next note without saving any changes.\\par\r\n{\\pntext\\f0 6.\\tab}\\b Exiting:\\b0  When you are done, click the save button when it says \"Exit\" to close the form.\\par\r\n\r\n\\pard\\b\\par\r\nMinor Changes:\\b0\\par\r\n\r\n\\pard{\\pntext\\f1\\\'B7\\tab}{\\*\\pn\\pnlvlblt\\pnf1\\pnindent0{\\pntxtb\\\'B7}}\\fi-360\\li720 The Change Log window will now only show up when the application starts unless the checkbox is below is checked.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 \"Don\'t show until next patch\" will now flash red/bold when it is not checked to draw attention to it.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 Fixed an error in Skipping Notes (Edit Notes) that caused the application to crash when clicking too many times.\\b\\par\r\n{\\pntext\\f1\\\'B7\\tab}\\b0 Added an Image that says \"Nothing Found\" when a search comes up empty.\\b\\par\r\n}\r\n'),
('4.5.0.3', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil Segoe UI;}}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\f0\\fs18 Patch Date: 02/02/2025\\par\r\nVersion: 4.5.0.3\\par\r\n\\par\r\nBug Fix: Transfer Tab will now correctly transfer a single item in the event where there are duplicates of that Item.  (Thanks 3rd Shift for finding this bug)\\par\r\n\\par\r\nBug Fix: Fixed Version Checker, this runs in the background and in the event where the application is updated remotly, it will autmatically prompt the user that they are using an outdated version if the application and close the app, allowing for a smoother update experience.\\f1\\par\r\n}\r\n'),
('4.5.1.0', '{\\rtf1\\ansi\\ansicpg1252\\deff0\\nouicompat\\deflang1033{\\fonttbl{\\f0\\fnil\\fcharset0 Segoe UI;}{\\f1\\fnil Segoe UI;}}\r\n{\\*\\generator Riched20 10.0.19041}\\viewkind4\\uc1 \r\n\\pard\\f0\\fs18 Patch Date: 03/19/2025\\par\r\nVersion: 4.5.1.0\\par\r\n\\par\r\nBug Fix: Bug where some users could not open app even though its not open, should hopefully be resolved now.\\par\r\n\\par\r\nBug Fix: Added User Based Logging: Each user has there own folder stored in the Expo Drive that has detailed information about each time they use the app.  Will be handy for future bug fixes.\\f1\\par\r\n}\r\n'),
('5.0.0.0', '# MTM WIP Application  Main Changes and How to Use the New Version\r\n\r\n**Effective Date:** July 2025\r\n\r\n---\r\n\r\n## Important Note About This Release\r\n\r\nThis is a brand new build of the MTM WIP Application, so some bugs or unexpected issues may appear as you start using it. For this reason, both the new and old versions will be available for now. Once the new version is fully tested and working smoothly for everyone, the old version will be removed from the system.  \r\nThe new version automatically pulls in any data entered in the old version each time it starts, so you wont lose any information by trying the new app.\r\n\r\n---\r\n\r\n## How to Start the New MTM WIP Application\r\n\r\n1. Go to `X:\\MH_RESOURCE` on your computer.\r\n2. Find the MTM Loader shortcut.\r\n3. Drag the shortcut to your desktop for easy access.\r\n4. Double-click the shortcut to launch the MTM WIP Application.\r\n\r\n---\r\n\r\n## MainForm\r\n\r\n- **How to Access:**  \r\n  The MainForm opens automatically when you start the app with MTM Loader.\r\n\r\n- **Whats New:**  \r\n  The MainForm now has a cleaner, simpler layout. The top menu gives you quick links to settings, reports, and your transaction history.  \r\n  At the bottom, a status bar shows when your changes are saved and whether youre connected to the database.  \r\n  You can move between tabs for inventory, removing items, and transferring itemsall from one window.  \r\n  Quick buttons help you get to common tasks faster, and hovering over areas will show helpful tips.  \r\n  Printing inventory lists is easy, and youll always see your connection status.  \r\n  All these changes are designed to make your day-to-day work easier and more organized.\r\n\r\n---\r\n\r\n## Settings Form (Adding and Removing Records)\r\n\r\n- **How to Access:**  \r\n  Click Settings from the MainForm.\r\n\r\n- **Whats New:**  \r\n  All adding and removing of users, parts, locations, and other records now happens in one simple place: the Settings Form.  \r\n  Choose what you want to manage, and the form will show just the fields you need. You can easily view all current records, add new ones, or remove any you dont need.  \r\n  You can act on multiple records at once, and the app gives clear messages if anything needs fixing before you save.  \r\n  Theres also a simple log of changes to help you keep track.  \r\n  This unified approach makes everything easier to find, reduces mistakes, and saves time.\r\n\r\n---\r\n\r\n## Transaction History (formerly \"Personal History Screen\")\r\n\r\n- **How to Access:**  \r\n  Click on Transaction History in the MainForm.\r\n\r\n- **Whats New:**  \r\n  The old Personal History screen is now called Transaction History, and its much clearer and easier to use.  \r\n  You can quickly see your activity, filter by date or type, view details for each transaction, and print lists when needed.  \r\n  This helps you keep track of your work and spot any issues right away.\r\n\r\n---\r\n\r\n## Theming and Personalization\r\n\r\n- **How to Access:**  \r\n  Go to the Settings menu in the app.\r\n\r\n- **Whats New:**  \r\n  You can now pick your own theme, color palette, and even font size. Changes appear instantly and are saved for you.  \r\n  If you want a new theme, just askit can be added quickly.  \r\n  Making the app look and feel the way you want helps everyone feel comfortable using it.\r\n\r\n---\r\n\r\n## Error Handling\r\n\r\n- **How to Access:**  \r\n  Any error or alert messages show up right where youre working.\r\n\r\n- **Whats New:**  \r\n  If something goes wrong, youll see a clear message explaining what happened and what to do next.  \r\n  Most problems wont interrupt your work, and you can check an error log for more details or for support.\r\n\r\n---\r\n\r\n## Performance\r\n\r\n- **Whats New:**  \r\n  Most background work now happens silently, so the app stays quick and responsive.  \r\n  Actions like searching or saving happen faster, with less waiting and no freezing.\r\n\r\n---\r\n\r\n## Removed or Changed Screens\r\n\r\n- **ForceCloseForm:**  \r\n  No longer included. If you need to manage processes, please use IT-approved tools.\r\n\r\n- **LoginPromptForm:**  \r\n  No longer included. The app now logs you in automatically through MTM Loader. (Shop2 and MTMDC logins will be handled separately in the future.)\r\n\r\n- **Entry/Removal Forms:**  \r\n  All the old separate forms for adding or removing records are goneeverything is now managed through the Settings Form.\r\n\r\n---\r\n\r\n## Summary\r\n\r\n- The new MTM WIP Application is easier to use, faster, and more reliable.\r\n- Managing records, viewing your transaction history, and changing how the app looks are all much simpler.\r\n- Always start the app using the MTM Loader shortcut for the best experience.\r\n- If you need help, check the user manual or contact your IT support team.\r\n\r\n---');
